import React from 'react';

const styles= {
    tags: {
        color: 'white'
    }
}
const tags = {
    htmlstart: "<html>",
    bodystart: "<body>"

}
const Landing = () => {

    return(

        <>
        <p style={styles.tags}>{tags.htmlstart}</p>
        <p style={styles.tags}>{tags.bodystart}</p>

        </>
    )
}
export default Landing
